import { Component } from '@angular/core';
import { GroupTaskListService } from 'src/services/group-task-list-service/group-task-list.service';
import { GroupTaskService } from 'src/services/group-task-service/group-task.service';

@Component({
  selector: 'app-boardcontent',
  templateUrl: './boardcontent.component.html',
  styleUrls: ['./boardcontent.component.css'],
  providers: [GroupTaskListService, GroupTaskService]
})
export class BoardcontentComponent {
  collapse: boolean = false;

  constructor(public group_task_service: GroupTaskListService) {}
}
